/** @format */

import React from 'react';

import './input.scss';

const Input = ({ label, inputChange }) => {
	return (
		<>
			<div className='input_fields'>
				<label>{label}</label>
				<input onChange={() => inputChange()} />
			</div>
		</>
	);
};

export default Input;
